#include <bits/stdc++.h>
using namespace std;
long long n, m, a, b;
bool check(long long t){
    if ((a + b) * t > n + m)
        return false;
    if (a == b){
        if (a * t <= n && a * t <= m)
            return true;
        else
            return false;
    }
    double low, high;
    if (a > b){
        low = (1.0 * a * t - m) / (a - b);
        high = (1.0 * n - b * t) / (a - b);
    }
    else{
        low = (1.0 * n - b * t) / (a - b);
        high = (1.0 * a * t - m) / (a - b);
    }
    long long L = ceil(low);
    long long R = floor(high);
    L = max(L, (long long)0);
    R = min(R, t);
    return (L <= R);
}
int main(){
    cin >> n >> m;
    cin >> a >> b;
    long long ans = 0;
    long long left = 0;
    long long right = max(n, m) / min(a, b) + 1;
    while (left <= right){
        long long mid = (left + right) / 2;
        if (check(mid)){
            ans = mid;
            left = mid + 1;
        }
        else{ 
            right = mid - 1;
        }
    }
    cout << ans;
    return 0;
}

#include <bits/stdc++.h>
using namespace std;
 
const int maxn=1e5+5;
int a[maxn];
int n,q,t;
 
int gcd(int a,int b) {
    if(b==0) return a;
    return gcd(b,a%b);
}
 
int main() {
    scanf("%d%d",&n,&q);
    for(int i=1; i<=n; i++) {
        scanf("%d",&a[i]);
    }
    sort(a+1,a+n+1);
    for(int i=2; i<=n; i++) {
        t=gcd(t,a[i]-a[i-1]);
    }
    for(int i=1; i<=q; i++) {
        printf("%d\n",gcd(t,a[1]+i));
    }
    return 0;
}
 
