#include<bits/stdc++.h>
using namespace std;
long long t,a,p;
long long ys[100010];
long long fpow(long long a,long long b,long long mod)
{
	if(b==0) return 1;
	if(b==1) return a%mod;
	if(b&1)  return a*fpow(a*a%mod,b>>1,mod)%mod;
	else return fpow(a*a%mod,b>>1,mod)%mod;
}
int main()
{
	cin>>t;
	while(t--)
	{
		cin>>a>>p;
		if(fpow(a,p-1,p)!=1)printf("No\n");
		else
		{
			int f=0,t=0;
			//找除了1和本身以外的其它因数，存起来
			for(int i=2;i*i<=p-1;i++)
			{
				if((p-1)%i==0)
				{
					ys[++t]=i;
					ys[++t]=(p-1)/i;
				}
			}
			for(int i=1;i<=t;i++)
			{
				if(fpow(a,ys[i],p)==1)
				{
					printf("No\n");
					f=1;
					break;
				}
			}
			if(f==0)
			{
				printf("Yes\n");
			}
		}
	}
	return 0;
}

#include <bits/stdc++.h>
#define endl '\n'  //宏定义换行
using namespace std;

const int N = 2e5+9;  //根据题目要求定义大小
int n, a[N], b[N], c[N];
/*
 * a：小 B 的出价
 * b：小 C 的出价
 * c：小 C 来买对答案的贡献
 */
long long ans; //千万别忘记 long long

int main() {
	ios::sync_with_stdio(false);//提高cin的速度
	cin.tie(0);
	cin >> n;
	for (int i = 1; i <= n * 2; i++)
		cin >> a[i];
	for (int i = 1; i <= n * 2; i++)
		cin >> b[i];
	for (int i = 1; i <= n * 2; i++) {
		// 默认小 B 进行购买
		ans += a[i];
		// 同时计算此时小 C 购买的贡献
		c[i] = b[i] - a[i];
	}
	// 最大化贡献 使答案更优
	sort(c + 1, c + 1 + n * 2);
	// 选最后 n 个就是最大的答案了
	for (int i = n * 2; i >= n + 1; i--)
		ans += c[i];
	cout << ans << endl;
	return 0;
}

#include <iostream>
#include <vector>
#include <cmath>
using namespace std;
const int MAX_N = 1e3 + 9;

long long n;
int sum;

int cal(int x)  //把x进行拆分 1 + 2 + 3 ......
{
    int p = 1 , num = 0;
    while(x >= p)
    {
        num++;
        x -= p;
        p++;
    }
    return num;  
}

int main()
{
    cin >> n;
    for(long long i = 2; i * i <= n; i++)
    {
        if(n % i == 0)  //i为n的因子
        {
            int cnt = 0;
            while(n % i == 0)
            {
                cnt++;
                n /= i;
            }
            sum += cal(cnt);
        }
    }
    if(n != 1)
        sum += cal(1);
    cout << sum;
    return 0;
}

#include<iostream>
#include<bits/stdc++.h>
#include<algorithm>
using namespace std;
const int maxm=1001,maxn=maxm;
long long n,m,p[maxn],c[maxm];
long long cnt[maxn];
vector<int> cs[maxn];
long long ans=1e18;
long long f(int ii){
	long long curcnt=cnt[1],res=0;
	vector<int> tmp;
	for(int i=2;i<=n;i++){
		int b=max((int)(cs[i].size()-ii+1),0);
		for(int j=0;j<b;j++){
			res+=cs[i][j];
		}
		curcnt+=b;
		for(int j=b;j<cs[i].size();j++){
			tmp.push_back(cs[i][j]);
		}
	}
	sort(tmp.begin(),tmp.end());
	for(int i=0;i<ii-curcnt;i++){
		res+=tmp[i];
	}
	return res;
}
int main(){
	cin>>n>>m;
	for(int i=1;i<=m;i++){
		cin>>p[i]>>c[i];
		cnt[p[i]]++;
		cs[p[i]].push_back(c[i]);
	}
	for(int i=1;i<=n;i++){
		sort(cs[i].begin(),cs[i].end());
	}
	for(int i=max((long long)(cnt[1]),1ll);i<=m;i++){
		ans=min(ans,f(i));
	}
	cout<<ans<<endl;
	return 0;
}

#include <bits/stdc++.h>
