const int maxn = 1e5 + 9;
int n, m, c[maxn], a[maxn] , mx = -1e9;
int main()
{
	cin >> n >> m; // n种武器  m场战斗
	for (int i = 1; i <= n; i++)
	{
		cin >> c[i];        // 第i种武器的初始熟练度
		mx = max(mx, c[i]); // 初始最大熟练度
	}

	for (int i = 1; i <= m; i++)
		cin >> a[i]; // 每场战斗武器熟练度的变化值

	//m场战斗 变化值>0 加入mx  变化值<0 加入其他武器
	for(int i = 1; i <= m; i++)
	{
		if(a[i] > 0 || n == 1)
			mx += a[i];
	}
	cout << mx;
	return 0;
}

#include<bits/stdc++.h>
using namespace std;
 
int n,m,k; 
int a[105][105];//该数组用来存储和输入 
int s[105][105];//该数组用来计算前缀和 
char c;//辅助输入（因为输入中没有空格需要用字符来先代替） 
int minn=2147483647; 
 
int main(){
	
	scanf("%d%d%d",&n,&m,&k);
	for(int i=1;i<=n;i++){
		for(int j=1;j<=m;j++){
			scanf(" %c",&c);//输入字符 
			a[i][j]=c-'0'; //将字符转化为整数 
			s[i][j]=s[i-1][j]+s[i][j-1]-s[i-1][j-1]+a[i][j];//计算前缀和 
		}
	}
	
	for(int x1=1;x1<=n;x1++){
		for(int j1=1;j1<=m;j1++){
			for(int x2=x1;x2<=n;x2++){ 
				for(int j2=j1;j2<=m;j2++){
					//因为x2>=x1并且j2>=j1，所以x2和j2分别从x1和j1开始枚举即可 
					if(s[x2][j2]-s[x2][j1-1]-s[x1-1][j2]+s[x1-1][j1-1]>=k){// s[x2][j2]-s[x2][j1-1]-s[x1-1][j2]+s[x1-1][j1-1]用来调用前缀和 
						int s=(x2-x1+1)*(j2-j1+1);//计算该矩形大小 
						minn=min(minn,s);
					}
				}
			}
		}
	}
    
	if(minn==2147483647){//特殊情况（无解） 
        printf("0");
        return 0;
    }
	printf("%d",minn);
	
    return 0;
}

