using namespace std;

/*
如果一个正整数的最大质因子不超过 B，则该正整数为 B-smooth 数。小杨同学想知道，对于给定的 n 和 B，有多少个不超过 n 的 B-smooth 数。
1 if x <= B then x is a B-smooth number
2 if x > B && x is prime number, then x is not a  B-smooth  number
3 if x > B && x is product of prime number, then x is not a B-smooth  number
 */

const int N = 1e6 + 1;
bitset<N> s, t;
int p[N], n, B, x = 0;

int main() {
    cin >> n >> B;
    if (n <= B) {
        cout << n;
        return 0;
    }

    for (int i = 2; i <= n; i++) {
        if (!s.test(i)) p[x++] = i;
        for (int j = 0; j < x && p[j] * i <= n; j++) {
            s.set(p[j] * i);
            if (i % p[j] == 0) break;
        }
    }

    int y = upper_bound(p, p + x, B) - p;

    for (; y < x; y++) {
        for (int i = 1; p[y] * i <= n; i++) {
            t.set(p[y] * i);
            //if(i % p[y] == 0) break;
        }
    }

    int sum = 0;
    for(int i = B + 1; i <= n; i++){
        if(t.test(i)) sum++;
    }

    cout << n - sum;

}

#include <cstdio>
#include <algorithm>
using namespace std;
char buf[1<<20],*p1,*p2;
int a[1000000];
inline char gc()  // 快速读字符
{
    return p1==p2&&(p2=(p1=buf)+fread(buf,1,1<<20,stdin))==buf?EOF:*p1++;
}
inline void read(int &x)  // 快读
{
    int c;
    while((c=gc())<'0'||c>'9');
    for(x=c^48;(c=gc())>='0'&&c<='9';x=(x<<3)+(x<<1)+(c^48));
}
int main()
{
	int n,st,ed;
	read(n);
    st=0,ed=n-1;  // 当前寻找最优解的范围
	for(int i=0;i<n;++i)
    {
        read(a[i]);
    }
    sort(a,a+n);
    for(int bit=1<<30;bit;bit>>=1)  // 从高到低按位枚举，bit标识当前位
    {
        if((a[st]&bit)||!(a[ed]&bit))  // 这位上全部相同，跳过
        {                              // 即最小的数这位为1，或最大的数这位为0
            continue;
        }
        if((a[ed]&bit)&&!(a[ed-1]&bit))  // 只有最后一个数这位为1
        {
            int t=a[ed]^=bit,i;
            for(i=ed-1;i>=st&&a[i]>t;--i)  // 单轮插入排序
            {
                a[i+1]=a[i];
            }
            a[i+1]=t;
        }
        else
        {
            int l=st,r=ed,mid;
            while(l<r)  // 二分0段和1段的分界点，找到第一个这位为1的数
            {
                mid=(l+r)>>1;
                if(a[mid]&bit) r=mid;
                else l=mid+1;
            }
            st=l;  // 缩小范围
        }
        if(ed-st<=1)  // 范围缩小到2个数以内，找到答案
        {
            break;
        }
    }
    printf("%d",a[st]&a[ed]);
	return 0;
}

#include <bits/stdc++.h>
using namespace std;

bool vis[1100000];

int main()
{
    int a, n;
    cin >> a >> n;

    vector<int> ans; // 存储幸运数字

    // 能得出当x=1000001 最差的幸运数为1002001，1002001为完全平方数
    for (int i = ceil(sqrt(a)); i <= 1001; i++)
    {
        int x = i * i; // x为完全平方数
        for (int j = 1; j * x <= 1002001; j++)
        {
            if (!vis[x * j])   //超级幸运数的倍数
            {
                ans.push_back(x * j);
                vis[x * j] = true;
            }
        }
    }
    sort(ans.begin() , ans.end());
    while (n--)
    {
        int x;
        cin >> x;
        if (vis[x])
            cout << "lucky" << endl;
        else
        {
            int pos = upper_bound(ans.begin(), ans.end(), x) - ans.begin();
            cout << ans[pos] << endl;
        }
    }
    return 0;
}

#include<bits/stdc++.h>
using namespace std;
 
struct game{//结构体用来存放每个游戏的时间和利益 
	int t;
	int r;
}a[505];
 
bool cmp(game a,game b){//cmp函数（结构体排序规则） 
	return a.r>b.r;
}
bool vis[505];//用来标记该时间是否空闲 
int sum;//收益和 
int main(){
	int n;
	scanf("%d",&n);
	for(int i=1;i<=n;i++){
		scanf("%d",&a[i].t);
	}
	for(int i=1;i<=n;i++){
		scanf("%d",&a[i].r);
	}
	
	sort(a+1,a+n+1,cmp);//排序 
	
	for(int i=1;i<=n;i++){
		bool k=0;//用来记录该任务是否能按时完成 
		for(int j=a[i].t;j>=1;j--){//按时间从大到小去枚举 
			if(vis[j]==0){//说明有时间 
				vis[j]=1;//标记，说明该时间已被占用 
				k=1;//该任务可以完成 
				break;
			}
		}
		if(k==1){//若该任务可以完成 
			sum+=a[i].r;//将该任务的收益加入累加器 
		}
	}
	printf("%d",sum);//输出 
	return 0;
}

#include <iostream>
using namespace std;
 
int main() {
    long long n, a;
    int p = 0; // 标志变量，控制乘号输出
    cin >> n;
    a = n;
 
    // 遍历可能的质因数，从2开始到i*i <=n
    for (long long i = 2; i * i <= n; i++) {
        if (a % i == 0) { // 发现质因数i
            int s = 0;
            while (a % i == 0) { // 除尽所有i的因子
                a /= i;
                s++;
            }
            // 输出格式处理
            if (p) cout << "* ";
            if (s != 1) cout << i << "^" << s << " ";
            else cout << i << " ";
            p = 1; // 标记已有因数输出
        }
    }
 
    // 处理剩余质因数
    if (a != 1) {
        if (a != n) cout << "* " << a; // 分解后的剩余质数
        else cout << a; // n本身是质数
    }
    return 0;
}
